import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav class="navbar navbar-expand-lg navbar-light bg-light">
      <span>
        <h1 id="header"><strong>Clicky Game</strong></h1>
      </span>
    </nav>
  );
}

export default Nav;
